import React from 'react';
import ReactDom from 'react-dom';
import {Name1,Name2,Name3} from './App';

ReactDom.render(

    <>
        <ol>
            <li>{Name1}</li>
            <li>{Name2}</li>
            <li>{Name3}</li>
            </ol>
    </>,

     document.getElementById('root')

);
